import React from "react"
// import Movie from "./components/Movie"
import axios from 'axios'

export default function App() {
    const [movies, setMovies] = React.useState([])
    React.useEffect(() => {
        axios.get("/movies")
            .then(res => setMovies(res.data))
            .catch(err => console.log(err))
    }, [])

    return(
        <div>
            AND MY AXE
            {movies}
        </div>
    )
}
